import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

import "./App.css";
import Home from "./pages/Home";
import Blogs from "./pages/blogs/Blogs";

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/" element={<Blogs />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
